import React, { Component } from 'react'
import axios from 'axios'
import {Route,Link,BrowserRouter as Router,Switch}from 'react-router-dom'
import Post from './Post'
import Popup from './Popup'


export default class Home extends Component {

     constructor(props){
         super(props);
        this.state={
            name:"",
            email:"",
            picture:"",
            images:[],
        }
     }


    componentDidMount =()=>{

        this.setState({name:localStorage.getItem('name')})
        this.setState({email:localStorage.getItem('email')})
        this.setState({picture:localStorage.getItem('picture')})

axios.get("https://dog.ceo/api/breeds/image/random/7")
.then(res =>{
    console.log(res.data.message)
    this.setState({images: res.data.message})
})
    }

    logout = ()=>{
        localStorage.clear()
    }
    render() {
        return (
            <div>
                <nav>
                    <Link to="/">Home  </Link> 
                    <Link to="/Contact"> Contact  </Link> 
                    <Link to="/logout" onClick={this.logout}> logout

                    </Link> 

                </nav>

                <Popup/>
               {this.state.images.map((item,i)=>{
                 return  <Post key={i} img={item} title ={"test"}/>
               })}
            </div>
        )
    }
}
